      this._url = url;
    }
    /**
     * @param {string} loaderId
     * @param {string} name
     */

  }, {
    key: "_onLifecycleEvent",
    value: function _onLifecycleEvent(loaderId, name) {
      if (name === 'init') {
        this._loaderId = loaderId;

